  const[user,setUser]= useState({role:""})
  console.log(document.cookie.token)
  if(user.role === "Sale")
    return (
      <Sale user={user}/>
  )
  if(user.role ==="Designer")
    return (
      <Designer user={user}/>
  );
  if(user.role ==="admin")
